from musicdb.albumoftheyear import MusicDBParamsimport dbparseimport inspectfrom dbparse import ParseFileTypedef test_parsemap():    mdbparams = MusicDBParams()    for parseName, parseType in mdbparams.parseMap.items():        assert isinstance(parseType, ParseFileType), f'parseName [{parseName}] does not have a ParseFileType'                parseClassName = getattr(parseType, "parseClassName")        assert isinstance(parseClassName, str), "No parse class name is set!"                parseClass = getattr(dbparse, parseClassName)        assert inspect.isclass(parseClass), f"No parse class with name [{parseClassName}]"                parseFunc = getattr(parseClass, "parse")        assert callable(parseFunc), f"parse() from {parseClassName} is not a callable"         if __name__ == "__main__":    test_parsemap()